SELECT Name
FROM demo.PersonalInformation
WHERE DateOfBirth > '1990-01-01';

SELECT ContactNumber, EmailID
FROM demo.PersonalInformation
WHERE LENGTH(LanguagesKnown) - LENGTH(REPLACE(LanguagesKnown, ',', '')) >= 1;

SELECT Name
FROM demo.PersonalInformation
WHERE LanguagesKnown LIKE '%English%' AND LanguagesKnown LIKE '%French%';

SELECT Name, EmailID
FROM demo.PersonalInformation
WHERE DateOfBirth BETWEEN '1980-01-01' AND '1990-12-31';

SELECT P.Name
FROM demo.PersonalInformation AS P
WHERE P.LanguagesKnown LIKE '%Spanish%' AND P.LanguagesKnown LIKE '%Mandarin%';
